import React, { useState } from 'react';
import '../css/review.css';
import sampleImage from '../assets/team-'; // Example item image
//import menuData from '../assets/menuData.json'; // Assuming you have item images in your menu data

const Review = () => {
    const [name, setName] = useState('');
    const [rating, setRating] = useState(0);
    const [reviewMessage, setReviewMessage] = useState('');
    const [reviews, setReviews] = useState([]);
    const [itemImage, setItemImage] = useState(sampleImage); // Default item image

    const handleSubmit = (e) => {
        e.preventDefault();
        const newReview = { name, rating, reviewMessage, itemImage };
        setReviews([...reviews, newReview]);
        setName('');
        setRating(0);
        setReviewMessage('');
    };

    return (
        <div className="review-container">
            <h1>Leave a Review</h1>
            <form onSubmit={handleSubmit} className="review-form">
                <div className="form-group">
                    <label htmlFor="name">Your Name:</label>
                    <input
                        type="text"
                        id="name"
                        value={name}
                        onChange={(e) => setName(e.target.value)}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="rating">Rating:</label>
                    <select
                        id="rating"
                        value={rating}
                        onChange={(e) => setRating(e.target.value)}
                        required
                    >
                        <option value="0">Select Rating</option>
                        <option value="1">1 Star</option>
                        <option value="2">2 Stars</option>
                        <option value="3">3 Stars</option>
                        <option value="4">4 Stars</option>
                        <option value="5">5 Stars</option>
                    </select>
                </div>
                <div className="form-group">
                    <label htmlFor="review-message">Review Message:</label>
                    <textarea
                        id="review-message"
                        value={reviewMessage}
                        onChange={(e) => setReviewMessage(e.target.value)}
                        required
                        placeholder="Write your review here..."
                    />
                </div>
                <button type="submit" className="submit-button">Submit Review</button>
            </form>

            {/* Display submitted reviews */}
            <div className="reviews-list">
                {reviews.map((review, index) => (
                    <div key={index} className="review-card">
                        <img src={review.itemImage} alt="Item" className="item-image" />
                        <h3>{review.name}</h3>
                        <p>Rating: {review.rating} Stars</p>
                        <p>{review.reviewMessage}</p>
                    </div>
                ))}
                {/* Static dummy reviews */}
                <div className="review-card">
                    <img src={sampleImage} alt="Item" className="item-image" />
                    <h3>Jane Doe</h3>
                    <p>Rating: 5 Stars</p>
                    <p>This cake was absolutely delicious! Highly recommend.</p>
                </div>
                <div className="review-card">
                    <img src={sampleImage} alt="Item" className="item-image" />
                    <h3>John Smith</h3>
                    <p>Rating: 4 Stars</p>
                    <p>Great service and the cake looked amazing. Will order again!</p>
                </div>
            </div>
        </div>
    );
};

export default Review;
